import React from 'react';

const PullingDetails = ({ config, onClose }) => {
  if (!config) return null;

  return (
    <div className="modal">
        <div className="modal-content">
            <h2>Details</h2>
            <p>{config.name}</p>
            <p>{config.description}</p>
            <p>{config.table_name}</p>
            <p>{config.columns}</p>
            <p>{config.table_type_id}</p>
            <p>{config.frequency_min}</p>
            <p>{config.data_source}</p>
            <p>{config.headers}</p>
            <p>{config.last_pulled_at}</p>
            <p>{config.created_date}</p>
            <button onClick={onClose}>Close</button>
        </div>
    </div>
  );
};

export default PullingDetails;
